gBox$MouseHandler',joc="Die Wettbewerbskommission der Schweiz (Weko) nimmt Kooperationsvereinbarungen zwischen dem f\xFChrenden Telekommunikationsunternehmen Swisscom und \xF6rtlichen Stromversorgern beim Bau von Glasfasernetzen unter die Lupe. Die Swisscom hatte Mitte 2009 angek\xFCndigt, in Ballungsr\xE4umen mit Fibre-to-the-Home (FTTH) k\xFCnftig voll auf Glasfaser zu setzen. Bis 2015 will der Konzern die St\xE4dte Z\xFCrich, Genf, Basel, St. Gallen, Bern, Lausanne und den Kanton Freiburg fl\xE4chendeckend mit FTTH versorgen. Dabei setzt die Swisscom nicht nur auf selbst installierte Glasfaserinfrastrukturen, sondern das Unternehmen will nach M\xF6glichkeit auch Infrastrukturen nutzen, die bereits von \xF6rtlichen Elektrizit\xE4tsversorgern aufgebaut wurden, die den Ausbau eigener Glasfasernetze zuletzt stark vorangetrieben hatten. Und dies ist Wettbewerbern ein Dorn im Auge. So reichte etwa der Verband der Kabelnetzbetreiber, Swisscable, im Mai 2010 Beschwerde bei der Weko wegen eines Kooperationsvertrages zwischen der Stadt St. Gallen und Swisscom ein. Der Vorwurf: Marktmissbrauch. Weko-Angaben zufolge gingen in den vergangenen Monaten noch weitere Meldungen zu Kooperationen zwischen Elektrizit\xE4tsversorgern und der Swisscom bei der Wettbewerbsbeh\xF6rde ein. Als erste Stadt habe St. Gallen einzelne Klauseln ihres Kooperationsvertrages im Rahmen eines Widerspruchsverfahrens zur \xDCberpr\xFCfung gemeldet, weshalb diese Kooperation auch als erste beurteilt werde. Bei diesen Vertragsklauseln sehe die Weko teilweise 'wettbewerbsrechtliche Probleme', weshalb sie jetzt eine Vorabkl\xE4rung er\xF6ffnet habe. Die ausgehandelten Vertragsklauseln, so die Weko, 'k\xF6nnten gem\xE4\xDF einer ersten Einsch\xE4tzung den Wettbewerb nachhaltig beschr\xE4nken und langfristig zu einer Monopolisierung der Glasfasernetzinfrastruktur f\xFChren'. Ins Visier nehmen die Wettbewerbsh\xFCter auch die geplante Gr\xFCndung eines Gemeinschaftsunternehmens zwischen der Swisscom und dem Energieversorger Groupe E zum Aufbau und Betrieb einer gemeinsamen Glasfaserinfrastruktur im Kanton Freiburg. Hier best\xFCnden Anhaltspunkte, dass das Gemeinschaftsunternehmen 'eine marktbeherrschende Stellung begr\xFCndet oder verst\xE4rkt'. (pmz) ",Qyc='Dimension',mkc='Dimension [height=',dvc='DirectionalTextHelper',gvc='DockLayoutPanel',hvc='DockLayoutPanel$Direction',ivc='DockLayoutPanel$Direction;',lvc='DockLayoutPanel$DockAnimateCommand',jvc='DockLayoutPanel$LayoutData',prc='DomEvent',urc='DomEvent$Type',yxc='Double',ihc='EAST',bcc='EEE, d MMM yyyy HH:mm:ss Z',enc='EEE. dd MMM. yyyy HH:mm:ss',vcc='EEEE, MMMM d',ecc='EEEE, MMMM d, y',E9b='EM',lfc='EMPTY',qfc='ENABLED',Idc='END',G9b='EX',Ktc='ElementMapperImpl',Ltc='ElementMapperImpl$FreeNode',xdc='English',Bqc='Enum',odc='Etc/GMT',qdc='Etc/GMT+',pdc='Etc/GMT-',Y9b='Event type',Ewc='Event$NativePreviewEvent',Hrc='EventBus',Rpc='EventObject',Wpc='Exception',Pfc='Expecting version 6 from server, got ',Uac='F',nlc='F8834F07517EF3B7D02B9E845E5E1B88',z9b='FIXED',lgc='FLOAT',Ukc='Fail: ',mbc='Feb',abc='February',Koc='Female',zxc='Float',mvc='FlowPanel',Muc='FocusWidget',ojc='For input string: "',Qbc='Fri',Jbc='Friday',kac='GET',vnc='GGD55XLBAH',gpc='GGD55XLBAJ',toc='GGD55XLBBI',unc='GGD55XLBCH',voc='GGD55XLBCI',Oec='GGD55XLBDB',tnc='GGD55XLBDH',ppc='GGD55XLBDJ',coc='GGD55XLBDK',Bec='GGD55XLBEB',rnc='GGD55XLBEH',uoc='GGD55XLBEI',hpc='GGD55XLBEJ',Pec='GGD55XLBFB',ync='GGD55XLBFH',Soc='GGD55XLBFI',Ipc='GGD55XLBFK',Poc='GGD55XLBGI',Gpc='GGD55XLBGK',Sec='GGD55XLBHB',Gnc='GGD55XLBHH',Doc='GGD55XLBHI',Fpc='GGD55XLBHK',Inc='GGD55XLBIH',Cpc='GGD55XLBIK',Hnc='GGD55XLBJH',Dmc='GGD55XLBJJ',Hpc='GGD55XLBJK',Tnc='GGD55XLBKG',ooc='GGD55XLBKH',Toc='GGD55XLBKI',xpc='GGD55XLBKK',Qnc='GGD55XLBLG',noc='GGD55XLBLH',Loc='GGD55XLBLI',ypc='GGD55XLBLK',Xnc='GGD55XLBMG',moc='GGD55XLBMH',Hmc='GGD55XLBMJ',Vnc='GGD55XLBNG',loc='GGD55XLBNH',wpc='GGD55XLBNK',imc='GGD55XLBOG',poc='GGD55XLBOH',Zmc='GGD55XLBOJ',jmc='GGD55XLBPG',Foc='GGD55XLBPI',FBc='G
